import React, { Component } from 'react';

import {
    AppBar,
    Toolbar,
    IconButton,
    Typography,
    Button
} from "@material-ui/core";
import MenuIcon from '@material-ui/icons/Menu';


class Header extends Component {
    render() {
        return (
            <AppBar position="static">
            <Toolbar>
                <Typography variant="h6">
                    Colin Perepelken
                </Typography>
            </Toolbar>
            </AppBar>
        );
    }
}

export default Header;
